import React from 'react'


export default function ({ coin , style}) {
    return (
        <div>
            <button>
                {coin.imageUrl}
                </button>
            <img
                alt={coin.CoinSymbol}
                style={style || {height: '50px'}}
                src={`http://cryptocompare.com/${coin.imageUrl}`}
            />

        </div>
    )
}
